        <section class="text-gray-600 body-font">
  <div class="container mx-auto flex px-5 py-24 md:flex-row flex-col items-center">
    <div class="lg:flex-grow md:w-1/2 lg:pr-24 md:pr-16 flex flex-col md:items-start md:text-left mb-16 md:mb-0 items-center text-center" style={{paddingTop:80}}>
      <h1 class="title-font sm:text-4xl text-3xl mb-4 font-medium text-gray-900">I'm Palash Jaithwar
        {/* <div class="hidden lg:inline-block"></div> */}
      </h1>
      <p class="mb-8 leading-relaxed">Copper mug try-hard pitchfork pour-over freegan heirloom neutra air plant cold-pressed tacos poke beard tote bag. Heirloom echo park mlkshk tote bag selvage hot chicken authentic tumeric truffaut hexagon try-hard chambray.</p>
      <div class="flex justify-center">
        
      </div>
    </div>
    <div class="lg:max-w-lg lg:w-full md:w-1/2 w-5/6" style={{paddingTop:50}}>
      <img class="object-cover object-center rounded" alt="hero" src="https://images.unsplash.com/photo-1570063578733-6a33b69d1439?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=753&q=80"/>
    </div>
  </div>
</section>
    )
}

export default HomePage;
